import './App.css';

function ThingsToDo(props) {

    const theToDoList = () => {
        return(
                props.toDoArray.map((item) => (<div class="toDoListItem"><input type="checkbox"></input>{item}<button type="submit">Clear</button></div>))    
            )        
    }



    return (
        <div>
        <p>a list of things to do will go here, with a button to delete when finished (or complete)?</p>
        <ul>{theToDoList()}</ul>
        </div>
    )
}







export default ThingsToDo;
